import React, { Component } from 'react';
import { Header } from 'semantic-ui-react'

class Resume extends Component {
  render() {
    return (
      <div>
        <Header as='h2' icon textAlign='center'>
          <Header.Content>Friends</Header.Content>
        </Header>
      </div>
    );
  }
}

export default Resume;
